member.example:
This sample shows how to call ClientAsync.

Model client = new ProjectedNameClient().GetModelClient();

ClientModel clientModel = new ClientModel(true);
Response response = await client.ClientAsync(clientModel);

This sample shows how to call ClientAsync with all parameters.

Model client = new ProjectedNameClient().GetModelClient();

ClientModel clientModel = new ClientModel(true);
Response response = await client.ClientAsync(clientModel);

This sample shows how to call Client.

Model client = new ProjectedNameClient().GetModelClient();

ClientModel clientModel = new ClientModel(true);
Response response = client.Client(clientModel);

